import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Layout from './components/layout/Layout';
import Dashboard from './components/dashboard/Dashboard';
import Chores from './components/chores/Chores';
import Guests from './components/guests/Guests';
import QuietTime from './components/quiet-time/QuietTime';
import Profile from './components/profile/Profile';
import GroupMembers from './components/group/GroupMembers';
import Login from './pages/Login';
import Register from './pages/Register';
import CreateHousehold from './components/household/CreateHousehold';
import JoinHousehold from './components/household/JoinHousehold';
import FindMembers from './components/find/FindMembers';
import FindGroups from './components/find/FindGroups';
import Inbox from './components/inbox/Inbox';
import { useAuth } from './context/AuthContext';

interface ProtectedRouteProps {
  children: React.ReactNode;
}

const ProtectedRoute: React.FC<ProtectedRouteProps> = ({ children }) => {
  const { user, loading } = useAuth();

  if (loading) {
    return (
      <div className="flex justify-center items-center h-screen">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-500"></div>
      </div>
    );
  }

  if (!user) {
    return <Navigate to="/login" />;
  }

  return <>{children}</>;
};

const AppRoutes: React.FC = () => {
  return (
    <Routes>
      <Route path="/login" element={<Login />} />
      <Route path="/register" element={<Register />} />
      <Route
        path="/"
        element={
          <ProtectedRoute>
            <Dashboard />
          </ProtectedRoute>
        }
      />
      <Route
        path="/profile"
        element={
          <ProtectedRoute>
            <Profile />
          </ProtectedRoute>
        }
      />
      <Route
        path="/settings"
        element={
          <ProtectedRoute>
            <Settings />
          </ProtectedRoute>
        }
      />
      <Route
        path="/find-members"
        element={
          <ProtectedRoute>
            <FindMembers />
          </ProtectedRoute>
        }
      />
      <Route
        path="/find-groups"
        element={
          <ProtectedRoute>
            <FindGroups />
          </ProtectedRoute>
        }
      />
      <Route
        path="/inbox"
        element={
          <ProtectedRoute>
            <Inbox />
          </ProtectedRoute>
        }
      />
    </Routes>
  );
};

export default AppRoutes;
